import React from 'react'
import ResultComponent from './ResultComponent'

const resultsComponent = ({results}) => {
    return (
       <section>
           {results.map(result => (
               <ResultComponent result = {result} />
           ))}
       </section>
    )
}

resultsComponent.propTypes = {

}

export default ResultsComponent
